import React from "react";
import styled from "styled-components";

function SignupPage() {
  const Main = styled.div`
    display: flex;
    flex-direction: row;
  `;

  const LeftContainer = styled.div`
    background: red;
    height: 100%;
    width: 40%;
  `;

  const RightContainer = styled.div`
    background: blue;
    height: 100%;
    width: 40%;
  `;

  return (
    <Main>
      <LeftContainer />
      <RightContainer />
    </Main>
  );
}

export default SignupPage;
